import React, { Component } from "react";
import { Link } from "react-router-dom";
class Aelement extends Component {
  constructor(props) {
    super(props);
    this.readMoreText = `Skaityti daugiau`;
    this.mountSinglePost = this.mountSinglePost.bind(this);
  }

  mountSinglePost() {
    const post = this.props.post;
  }

  render() {
    return (
      <Link
        to={{
          pathname: `/posts/${this.props.id}`,
        }}
        data-post={this.props.id}
        className="btn btn-lg btn-dark postButton"
        wholepost={this.props.post}
        onClick={this.mountSinglePost}
      >
        {this.readMoreText}
      </Link>
    );
  }
}

export default Aelement;
